import Link from 'next/link';
import { useRouter } from 'next/router';
import React from 'react';
import { Button } from '../../components/Button';
import { Panel } from '../../components/Panel';
import faker from 'faker';

const ReputationSubApp = () => {
	const router = useRouter();
	return (
		<div className="pt-6 grid grid-cols-7 gap-6">
			<div className="col-span-5">
				<Panel header={{ content: 'Profile Posts' }}>
					<table className="table-auto w-full">
						<thead className="text-left">
							<tr>
								<th>Name</th>
								<th>Type</th>
								<th>Comment</th>
							</tr>
						</thead>
						<tbody>
							{[
								{
									name: faker.name.findName(),
									type: -1,
									content: faker.lorem.text(),
								},
							].map((rep) => {
								return (
									<tr>
										<td>{rep.name}</td>
										<td>{rep.type}</td>
										<td>{rep.content}</td>
									</tr>
								);
							})}
						</tbody>
					</table>
				</Panel>
			</div>
			<div className="col-span-2">
				<Panel compact={true} header={{ content: 'Reputation Overview' }}>
					<ul className="space-y-2">
						<li className="flex items-center justify-between font-medium">
							<p>Positive</p>
							<p className="text-positive-cta">22 (98%)</p>
						</li>
						<li className="flex items-center justify-between font-medium">
							<p>Neutral</p>
							<p>1 (1%)</p>
						</li>
						<li className="flex items-center justify-between font-medium">
							<p>Negative</p>
							<p className="text-negative-cta">4 (2%)</p>
						</li>
					</ul>
					{/* <Link href={`/users/${router.query.id}?tab=reputation`} passHref>
						<Button
							outline={true}
							compact={true}
							className="w-full justify-center mt-6"
						>
							View all reputation
						</Button>
					</Link> */}
				</Panel>
			</div>
		</div>
	);
};

export default ReputationSubApp;
